import ma2 from '../assets/img/ma2.png';

const First = () => {
    return (
        <div>
            <div className="flex justify-center items-center h-screen">
                <div className="w-full h-full bg-cover bg-center" style={{backgroundImage: `url(${ma2})`}}></div>
            </div>
            <div className="flex ml-10 mt-4">
                <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mr-2">Button 1</button>
                <button className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded mr-2 ml-4">Button 2</button>
                <button className="bg-yellow-500 hover:bg-yellow-700 text-white font-bold py-2 px-4 rounded mr-2 ml-4">Button 3</button>
                <button className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded ml-4">Button 4</button>
            </div>
            <div className="mt-4 text-center">
                <p className="text-lg font-bold">Overview</p>
                <p className="text-gray-700">Add your overview text here.</p>
            </div>
        </div>
    );
}

export default First;
